import React from 'react';

var Proset = {
    Problem: 'Test',
    Choice1: '1',
    Choice2: '2',
    Choice3: '3',
    Choice4: '4',
    Answer: 3
}

class Problem extends React.Component {

    render () {
        return (
            <div className="Survey">
                <h1>Problem</h1>
                <p>{Proset.Choice1}</p>
                <button onClick={() => {
                window.location.href="/"
                }}>To Root</button>
            </div>
        )
    }
}

export default Problem;
